import {FaBars} from "react-icons/fa"

function Home() {
    return(<main>
        <button className="sidebar-toggle">
            <FaBars></FaBars>
        </button>
    </main>)
    
}

function Modal(params) {
    return;
}

function Sidebar(params) {
    return;
    
}


export const NavApp = () => {
    return (
        <>
         <Home></Home>   
         <Modal></Modal>
         <Sidebar></Sidebar>
        </>
    )
}
